  public File toFile(String base64Code) throws IOException{
    FileOutputStream out = null;
    try {

      Base64.Decoder decoder = Base64.getDecoder();
      byte[] b = decoder.decode(base64Code);
      for(int i=0;i<b.length;++i)
      {
        if(b[i]<0)
          //调整异常数据
          b[i]+=256;
      }

      File file = new File("D:\\temp\\"+ Calendar.getInstance().getTimeInMillis() + ".jpg");
      out = new FileOutputStream(file);
      out.write(b);

      return file;
    }catch (Exception e){
      e.printStackTrace();
      return null;
    }finally{
      out.close();
    }

  }

